import React from "react";
import { Link } from "react-router-dom";

const Works = () => {
	return (
		<div>
			<Link to="/works/concret-case">Concret case</Link>
			<Link to="/works/exercises">Exercises</Link>
			<Link to="/works/case-study">Case study</Link>
		</div>
	);
};

export default Works;

// 3 liens seront alors
// 			disponibles : "Exercices", "Case Study" et "Concret case".
